import "../styles/welcome.css"
import { plot } from "plotly.js";
import { Card, Container, Button, Col, Row } from "react-bootstrap";
import SimpleImageSlider from "react-simple-image-slider";
import home_img from "../statics/imgs/home_scrn.jpg"

const Welcome = () => {
    return (
        <section className="bg-image">
            <div className="welc-div">
                <Row>
                    <div className="p-2 ">
                        <Row>
                            <h1 className=" d-flex justify-content-center"><b>Get a wider angle on coderhub.sa</b></h1>
                            <h5 className=" d-flex justify-content-center">Explore coderhub.sa leaderboard data in a better way and gain more insights</h5>
                        </Row>
                    </div>
                    <div className="mt-2 d-flex justify-content-center mt-5 ">
                        <img className="image shadow-lg d-none d-xs-block d-md-none" src={home_img} height={200} width={300}></img>
                        <img className="image shadow-lg d-lg-none d-sm-none" src={home_img} height={300} width={500}></img>        
                        <img className="image shadow-lg d-none d-lg-block" src={home_img} height={500} width={900}></img>
                    </div>
                </Row>
            </div>
            <div>
                <h3>analyze top users</h3>
            </div>
        </section>
    );
}

export default Welcome;
